var searchInput=document.getElementById("searchInput"),delay=makeDelay(1e3);function makeDelay(e){var t=0;return function(n){clearTimeout(t),t=setTimeout(n,e)}}function getFodmaps(e){Aias.HTTP.GET('http://nutrimetrics.estellepicq.com/food?fodmaps=1&searchTerm="'+e+'"',"json").then(e=>{console.log(e)}).catch(e=>{console.log("error",e)})}searchInput.addEventListener("keyup",function(){delay(function(){var e=getFodmaps(searchInput.value);console.log(e)})});